import React from 'react'

import SortMenu from './SortMenu'

function Header() {
  return (
    <div className="header">
      <div className="logo">
        {/* <img src="/images/logo.png" /> */}
        <img src="/images/hamburger.png" />
      </div>
      <SortMenu />
    </div>
  );
}

export default Header
